var startX, startY;
var selList = [];
var a = []
const DS_LONG = ['Понеділок', 'Вівторок', 'Середа', 'Четвер', 'П\'ятниця', 'Субота', 'Неділя'];
const DS = ['Пн', 'Вв', 'Ср', 'Чт', 'Пт', 'Сб', 'Нд'];	
var DAYS_LONG = []
var DAYS = []

const lessonsTime = [585, 645, 705, 765, 825, 885, 945];
const rowDef = {grp:'',day:'',dayLong:'',num:0,sub:'',sub2:'',sub3:'',tch:'',tch2:'',tch3:'',kab:0,kab2:0,kab3:0,
				subZn:'',subZn2:'',subZn3:'',tchZn:'',tchZn2:'',tchZn3:'',kabZn:0,kabZn2:0,kabZn3:0}
const sColorError = 'tt--color-3';
const sColorCurr = 'tt--color-4';
var color = 'tt--color-1';
var activeCol = 'tch';
var currTime = 'Пн-1';

//---------------------------------------------------------------------------
//---------------------------------------------------------------------------
function GetCurrentTime() {
	let d = new Date();
	let m = new Date();
	let g = new Date();
	let day = d.getUTCDay();
	let min = 60 * g.getHours() + m.getMinutes();

	let i = 0;
	while (i < 7 && lessonsTime[i] + 3 <= min) {
		i += 1;
	}
	if (i === 7) i = 6;

	if (day === 0 || day === 6) {
		day = 0;
		i = 0;
	} else {
		day -= 1;
	}
	return DAYS[10 * day + i];
}

//-------------------------------------------
//-------------------------------------------
function isWorkDay(num) {
	return num % 10 <= 6 && num < 50;
}

//-------------------------------------------
//-------------------------------------------
function CreateData() {
	
	for (let j = 0; j < 7; j++) {
		for (let i = 0; i < 10; i++) {
			DAYS.push(DS[j] + '-' + String(i + 1));
			DAYS_LONG.push(DS_LONG[j] + '-' + String(i + 1));			
		}
	}
		//----------------------------------
	let x = 0;
	for (let row of a0) {
		x = (row.num % 7) * 10 + Math.trunc(row.num / 7)
		row.num = x;
		row.day = DAYS[x];
		row.dayLong = DAYS_LONG[x];
			
			// не зберігати порожні рядки які більше 7 уроку і більше пятниці
		if (isWorkDay(x) || row.sub !== '' || row.kab !== 0 || row.tch !== '' || row.sub2 !== '' || row.kab2 !== 0 || row.tch2 !== '' || row.sub3 !== '' || row.kab3 !== 0 || row.tch3 !== '' || row.subZn !== '' || row.kabZn !== 0 || row.tchZn !== '' ||
			row.subZn2 !== '' || row.kabZn2 !== 0 || row.tchZn2 !== '' || row.subZn3 !== '' || row.kabZn3 !== 0 || row.tchZn3 !== '') {
			a.push(row);
		}
	}

		//----------------------------------
	currTime = GetCurrentTime();
	Filter('day', currTime);
}

//-------------------------------------------
//-----------------------------------------
function HTMLFilter(index) {
	if (index >= 0 && index < selList.length) Filter(activeCol, selList[index]);
}
//-----------------------------------------
function Filter(col, value) {
	if (col === 'kab') value = Number(value);
	if (col !== activeCol) {
		activeCol = col;
		selList = Unique(col, value);
		document.getElementById('listBox').innerHTML = '<option>' + selList.join('</option><option>') + '</option>';					
	}
		// фільтрування ---------------------------------
	let s = '';
	if (col === 'day') s = FilterDay(value);
	if (col === 'grp') s = FilterGrp(value);
	if (col === 'kab') s = FilterKab(value);
	if (col === 'tch') s = FilterTch(value);

	if (col === 'day' && value.length <= 4) value = DAYS_LONG[DAYS.indexOf(value)];
	document.getElementById('listBox').selectedIndex = selList.indexOf(value);
	document.getElementById('tableData').innerHTML = s;
}

//-------------------------------------------
//-------------------------------------------
function Unique(col, value) {
	let list = [];
	let myList = [];
	if (col === 'day') col = 'dayLong';
	for (let row of a) {
		list.push(row[col]);
	}
	myList = [...new Set(list)].filter(Boolean);
	if (col === 'kab') {
		myList.sort((x, y) => x - y);
	} else if (col === 'dayLong') {
		myList.sort((x, y) => DAYS_LONG.indexOf(x) - DAYS_LONG.indexOf(y));
	} else {
		myList.sort();
	}
	return myList;
}

//-------------------------------------------
//-----------------------------------------------
function touchStart() {
	startX = event.touches[0].clientX;
	startY = event.touches[0].clientY;
}
//-----------------------------------------------
function touchEnd(n) {
	let dX = event.changedTouches[0].clientX - startX;
	let dY = event.changedTouches[0].clientY - startY;
	if (dX > 50 && Math.abs(dX) > Math.abs(dY)) HTMLFilter(n - 1);
	if (dX < -50 && Math.abs(dX) > Math.abs(dY)) HTMLFilter(n + 1);
}

//-------------------------------------------
//-------------------------------------------
function SaveDay(n) {
	s = '<td class="tt-day ' + color + '" onclick="Filter(\'day\',\'' + n + '\')">' + n;
	return s + '</td>';
}
function SaveGrp(n) {
	let s = '<td class="tt-grp ' + color;
	if (n === '') {
		s += '">&nbsp;';
	} else {
		s += '" onclick="Filter(\'grp\',\'' + n + '\')">' + n;
	}
	return s + '</td>';
}
function SaveKab(n) {
	let s = '<td class="tt-kab ' + color;
	if (n <= 0) {
		s += '">&nbsp;';
	} else {
		s += '" onclick="Filter(\'kab\',\'' + n + '\')">' + n;
	}
	return s + '</td>';
}
function SaveTch(n) {
	let s = '<td class="tt-tch ' + color;
	if (n === '') {
		s += '">&nbsp;';
	} else {
		s += '" onclick="Filter(\'tch\',\'' + n + '\')">' + n;
	}
	return s + '</td>';
}
function SaveSub(n, x) {
	let sign;
	if (x < 0) sign = '* ' + n;
	if (x > 0) sign = n + ' *';
	if (x === 0) sign = n;
	let s = '<td class="tt-sub ' + color;
	if (n === '') {
		s += '">&nbsp;';
	} else {
		s += '">' + sign;
	}
	return s + '</td>';
}
//-------------------------------------------
//-------------------------------------------
function FilterDay(value) {

		// якщо Понеділок-4 (повне) - то записуємо скорочено Пн-4
	if (value.length > 4) value = DAYS[DAYS_LONG.indexOf(value)];
	let rows = a.filter(row => row.day === value);
	rows.sort((x, y) => x.grp > y.grp);
	
	let s = '';
	let sColor;

	for (let row of rows) {
		sColor = (row.grp === '' || Number(row.grp[0]) % 2 === 1) ?	'tt--color-1' : 'tt--color-2';

			//----- day-1 -----------------------
		if (row.kab !== 0 || row.tch !== '' || row.sub !== '' || isWorkDay(row.num)) {
			color = (row.grp === '' || row.kab === 15) ? sColorError : sColor;
			s += '<tr>' + SaveGrp(row.grp);
			if ((row.kab === row.kabZn && row.tch === row.tchZn && row.sub === row.subZn) ||
			(row.kab === row.kabZn2 && row.tch === row.tchZn2 && row.sub === row.subZn2) ||
			(row.kab === row.kabZn3 && row.tch === row.tchZn3 && row.sub === row.subZn3)) {
				s += SaveSub(row.sub, 0);
			} else {
				s += SaveSub(row.sub, 1);
			}
			s += SaveKab(row.kab) + SaveTch(row.tch) + '</tr>';
		}
			//----- day-2 -----------------------
		if (row.kab2 !== 0 || row.tch2 !== '' || row.sub2 !== '') {
			color = (row.tch2 === row.tch || row.kab2 === row.kab || row.kab2 === 15) ? sColorError : sColor;
			s += '<tr>' + SaveGrp(row.grp);
			if (row.sub2 === row.sub) {
				s += SaveSub('', 0);
			} else if 
				((row.kab2 === row.kabZn && row.tch2 === row.tchZn && row.sub2 === row.subZn) ||
				(row.kab2 === row.kabZn2 && row.tch2 === row.tchZn2 && row.sub2 === row.subZn2) ||
				(row.kab2 === row.kabZn3 && row.tch2 === row.tchZn3 && row.sub2 === row.subZn3)) {
				s += SaveSub(row.sub2, 0);
			} else {
				s += SaveSub(row.sub2, 1);
			}
			s += SaveKab(row.kab2) + SaveTch(row.tch2) + '</tr>';	
		}
			//----- day-3 -----------------------
		if (row.kab3 !== 0 || row.tch3 !== '' || row.sub3 !== '') {
			color = (row.tch3 === row.tch2 || row.tch3 === row.tch3 || row.kab3 === row.kab2 || row.kab3 === row.kab || row.kab3 === 15) ? sColorError : sColor;
			s += '<tr>' + SaveGrp(row.grp);
			if (row.sub3 === row.sub2) {
				s += SaveSub('', 0);
			} else if 
				((row.kab3 === row.kabZn && row.tch3 === row.tchZn && row.sub3 === row.subZn) ||
				(row.kab3 === row.kabZn2 && row.tch3 === row.tchZn2 && row.sub3 === row.subZn2) ||
				(row.kab3 === row.kabZn3 && row.tch3 === row.tchZn3 && row.sub3 === row.subZn3)) {
				s += SaveSub(row.sub3, 0);
			} else {
				s += SaveSub(row.sub3, 1);
			}
			s += SaveKab(row.kab3) + SaveTch(row.tch3) + '</tr>';	
		}
			//----- day-Zn -----------------------
		if ((row.subZn !== '' || row.kabZn !== 0 || row.tchZn !== '') &&
			(row.subZn !== row.sub || row.kabZn !== row.kab || row.tchZn !== row.tch) &&
			(row.subZn !== row.sub2 || row.kabZn !== row.kab2 || row.tchZn !== row.tch2) &&
			(row.subZn !== row.sub3 || row.kabZn !== row.kab3 || row.tchZn !== row.tch3)) {
			color = (row.kabZn === 15) ? sColorError : sColor;
			s += '<tr>' + SaveGrp(row.grp) + SaveSub(row.subZn, -1) + SaveKab(row.kabZn) + SaveTch(row.tchZn) + '</tr>';				
		}
			//----- day-Zn-2 -----------------------		
		if ((row.subZn2 !== '' || row.kabZn2 !== 0 || row.tchZn2 !== '') &&
			(row.subZn2 !== row.sub || row.kabZn2 !== row.kab || row.tchZn2 !== row.tch) &&
			(row.subZn2 !== row.sub2 || row.kabZn2 !== row.kab2 || row.tchZn2 !== row.tch2) &&
			(row.subZn2 !== row.sub3 || row.kabZn2 !== row.kab3 || row.tchZn2 !== row.tch3)) {
			color = (row.kabZn2 !== row.kabZn || row.tchZn2 !== row.tchZn || row.kabZn2 === 15) ? sColorError : sColor;	
			s += '<tr>' + SaveGrp(row.grp);
			(row.subZn2 === row.subZn) ? s += SaveSub('', 0) : s += SaveSub(row.subZn2, -1);
			s += SaveKab(row.kabZn2) + SaveTch(row.tchZn2) + '</tr>';
		}
			//----- day-Zn-3 -----------------------		
		if ((row.subZn3 !== '' || row.kabZn3 !== 0 || row.tchZn3 !== '') &&
			(row.subZn3 !== row.sub || row.kabZn3 !== row.kab || row.tchZn3 !== row.tch) &&
			(row.subZn3 !== row.sub2 || row.kabZn3 !== row.kab2 || row.tchZn3 !== row.tch2) &&
			(row.subZn3 !== row.sub3 || row.kabZn3 !== row.kab3 || row.tchZn3 !== row.tch3)) {
			color = (row.kabZn3 !== row.kabZn || row.tchZn3 !== row.tchZn || row.kabZn3 !== row.kabZn2 || row.tchZn3 !== row.tchZn2 || row.kabZn3 === 15) ? sColorError : sColor;	
			s += '<tr>' + SaveGrp(row.grp);
			(row.subZn3 === row.subZn2) ? s += SaveSub('', 0) : s += SaveSub(row.subZn3, -1);
			s += SaveSub(row.subZn3, -1) + SaveKab(row.kabZn3) + SaveTch(row.tchZn3) + '</tr>';			
		}				
	}
	return s;
}

//-------------------------------------------
//-------------------------------------------
function FilterTch(value) {

	let rows = a.filter(row => row.tch === value || row.tch2 === value || row.tch3 === value 
		|| row.tchZn === value || row.tchZn2 === value || row.tchZn3 === value);
	for (let i = 0; i < DAYS.length; i++) {
		if (isWorkDay(i) && rows.find(row => row.num === i) === undefined) {
			row = {...rowDef};
			row.tch = value;
			row.num = i;
			row.day = DAYS[i];
			row.dayLong = DAYS_LONG[i];
			rows.push(row); 
		}
	}
	rows.sort((x, y) => x.num - y.num);

	let s = '';
	let sColor;
	
	for (let row of rows) {
		sColor = (Math.trunc(row.num / 10) % 2 === 0) ? 'tt--color-1' : 'tt--color-2';
		if (row.day === currTime) sColor = 'tt--color-4';

			//----- tch-1 -----------------------
		if (row.tch === value) {
			color = (row.kab === 15) ? sColorError : sColor;
			s += '<tr>' + SaveDay(row.day) + SaveGrp(row.grp) + SaveKab(row.kab);
			if ((row.kab === row.kabZn && row.sub === row.subZn && row.tch === row.tchZn) ||
			(row.kab === row.kabZn2 && row.sub === row.subZn2 && row.tch === row.tchZn2) ||
			(row.kab === row.kabZn3 && row.sub === row.subZn3 && row.tch === row.tchZn3)) {
				s += SaveSub(row.sub, 0);
			} else {
				s += SaveSub(row.sub, 1);
			}
			s += '</tr>';
		}
			//----- tch-2 -----------------------		
		if (row.tch2 === value) {
			color = (row.tch2 === row.tch || row.kab2 === 15) ? sColorError : sColor;
			s += '<tr>' + SaveDay(row.day) + SaveGrp(row.grp) + SaveKab(row.kab2);
			if ((row.kab2 === row.kabZn && row.sub2 === row.subZn && row.tch2 === row.tchZn) ||
			(row.kab2 === row.kabZn2 && row.sub2 === row.subZn2 && row.tch2 === row.tchZn2) ||
			(row.kab2 === row.kabZn3 && row.sub2 === row.subZn3 && row.tch2 === row.tchZn3)) {
				s += SaveSub(row.sub2, 0);
			} else {
				s += SaveSub(row.sub2, 1);
			}
			s += '</tr>';
		}
			//----- tch-3 -----------------------		
		if (row.tch3 === value) {
			color = (row.tch3 === row.tch2 || row.tch3 === row.tch || row.kab3 === 15) ? sColorError : sColor;
			s += '<tr>' + SaveDay(row.day) + SaveGrp(row.grp) + SaveKab(row.kab3);
			if ((row.kab3 === row.kabZn && row.sub3 === row.subZn && row.tch3 === row.tchZn) ||
			(row.kab3 === row.kabZn2 && row.sub3 === row.subZn2 && row.tch3 === row.tchZn2) ||
			(row.kab3 === row.kabZn3 && row.sub3 === row.subZn3 && row.tch3 === row.tchZn3)) {
				s += SaveSub(row.sub3, 0);
			} else {
				s += SaveSub(row.sub3, 1);
			}
			s += '</tr>';
		}
			//----- tch-Zn -----------------------		
		if ((row.tchZn === value) && 
			(row.subZn !== row.sub || row.kabZn !== row.kab) &&
			(row.subZn !== row.sub2 || row.kabZn !== row.kab2) &&
			(row.subZn !== row.sub3 || row.kabZn !== row.kab3)) {
			color = (row.kabZn === 15) ? sColorError : sColor;
			s += '<tr>' + SaveDay(row.day) + SaveGrp(row.grp) + SaveKab(row.kabZn) + SaveSub(row.subZn, -1) + '</tr>';
	}
			//----- tch-Zn-2 -----------------------		
		if ((row.tchZn2 === value) && 
			(row.subZn2 !== row.sub || row.kabZn2 !== row.kab) &&
			(row.subZn2 !== row.sub2 || row.kabZn2 !== row.kab2) &&
			(row.subZn2 !== row.sub3 || row.kabZn2 !== row.kab3)) {
			color = (row.tchZn2 === row.tchZn || row.kabZn2 === 15) ? sColorError : sColor;	
			s += '<tr>' + SaveDay(row.day) + SaveGrp(row.grp) + SaveKab(row.kabZn2) + SaveSub(row.subZn2, -1) + '</tr>';
		}
			//----- tch-Zn-3 -----------------------		
		if ((row.tchZn3 === value) && 
			(row.subZn3 !== row.sub || row.kabZn3 !== row.kab) &&
			(row.subZn3 !== row.sub2 || row.kabZn3 !== row.kab2) &&
			(row.subZn3 !== row.sub3 || row.kabZn3 !== row.kab3)) {
			color = (row.tchZn3 === row.tchZn2 || row.tchZn3 === row.tchZn || row.kabZn3 === 15) ? sColorError : sColor;
			s += '<tr>' + SaveDay(row.day) + SaveGrp(row.grp) + SaveKab(row.kabZn3) + SaveSub(row.subZn3, -1) + '</tr>';			
		}				
	}
	return s;
}	

